import React from 'react';
import { secondary, titleTextColor } from './colors.js';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Button } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  titleText: {
    color: titleTextColor,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
   // transform: 'translateY(-50%)',
    letterSpacing: '0.3em',
    display: 'block',
  },
  smallerTextTheme: {
    color: secondary,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
    fontSize: '0.75em',
    letterSpacing: '0.2em',
    marginTop: '20px',
    marginRight: '50px',
    display: 'block',
  },
  center: {
    center: {
      display: 'flex',
      justifyContent: 'flex-start', 
      alignItems: 'flex-end', 
      flexDirection: 'column',
      height: '200vh', 
      paddingRight: '50px',
    },
    
  },
}));

function TitleContent() {
  const classes = useStyles();
  return (
    <div className={classes.center}>
      <div className={classes.titleText}>
        <span style={{ fontSize: '3em' }}>E</span>
        <span style={{ fontSize: '2.5em' }}>AN VANDERGRAAF</span>
      </div>
      <div className={classes.smallerTextTheme}>Software Engineer</div>
      <div className={classes.smallerTextTheme}>helloa</div>
    </div>
  );
}

export default TitleContent;
